        "topLevelComment": {
          "kind": "youtube#comment",
          "etag": "TopEDD6cpgNm7UFg9jeXUwD5lF8",
          "id": "Ugy7RWL13qo1hKEssm14AaABAg",
          "snippet": {
            "videoId": "yuD34tEpRFw",
            "textDisplay": "Matter and dark matter: Galaxies rotate too fast but are not torn apart.  What causes galaxies from flying apart?\u003cbr\u003e\u003cbr\u003eBy Csaba A. Bodor.  Last edited April 4, 2022\u003cbr\u003e\u003cbr\u003egravity, they say, is associated with baryonic matter and with dark matter.  EVEN better:  gravity is associated with the mass of baryonic matter and the SPEED of motion of the former.  Dark matter gravity is caused by ordinary baryonic matter in motion!\u003cbr\u003e\u003cbr\u003eSome speculate that a mysterious substance called &quot;dark matter&quot; must exist which holds the galaxies together.    I submit that this dark matter is nothing more than ordinary matter which is in motion around the galactic core and around the billions of stars.\u003cbr\u003e\u003cbr\u003eMatter that is in motion presses against the aether of space (to those stuck in the Einstein loop, it is also called space-time) and the aether presses back in the form of gravity and the moving matter also creates time dilation.\u003cbr\u003e\u003cbr\u003eThis gravity could be the missing gravity that is holding galaxies together. \u003cbr\u003e\u003cbr\u003eThere are two types of time dilation.  One is caused by the aether&#39;s affect on matter and the other is the aether&#39;s affect on speeding matter or electromagnetic &quot;waves&quot;.\u003cbr\u003eAs matter, of any size, displaces the aether, the aether presses back with what we call gravity.  This gravity presses on the matter affecting it&#39;s &quot;being&quot;.  All activity of matter os slowed down.  The cesium in a cesium clock runs slower because the nuclear particles of cesium are slowed down.  The clock therefore runs slower.  Radioactive elements all run slower; their half-lifes are increased. Their internal subatomic particles run slower.  \u003cbr\u003eThe microprocessors and other perts of computers all run slower.  Our brains are affected also and our minds work slower.  Everything near and about that matter that intruded into the realm that belongs to the aether runs slower.\u003cbr\u003e\u003cbr\u003eAs one moves away from the mass of that large mass we live on the press of the aether becomes less and the particles and pieces of the atoms will run faster since the gravity created by the aether slowly lessons as we move away from the large mass.  That cesium clock runs faster.  The half-life of the radioactive elements changes and its &quot;time&quot; is affected.\u003cbr\u003e\u003cbr\u003eHumans living further from the mass of the earth will perceive time as running faster.  Computers will likewise run faster.\u003cbr\u003e\u003cbr\u003eTime dilation that is caused by motion comes about because of the motion of matter or electromagnetic waves through the aether.  A photon traveling at &quot;C&quot; pushes against the aether, the aether pushes back and creates gravity.  The internal properties of the photon or even matter are slowed down.  As humans move through the aether at great speeds we perceive the time runs slower for us.  Time dilation.\u003cbr\u003e\u003cbr\u003eFor a photon, because it is traveling at &quot;C&quot;, time actually stops.  The photon experiences NO time.\u003cbr\u003e\u003cbr\u003eThe photon cannot travel faster than &quot;C&quot; because the aether sets the speed limit by pushing against the photon&#39;s motion through the aether.  This is also why matter cannot go faster than &quot;C&quot;.  \u003cbr\u003e\u003cbr\u003eWhen light goes through a gas or a liquid it is forced to slow down and give part of its energy to the gas or liquid which eats into the photon&#39;s ability to move at &quot;C&quot;. The energy given up heats up the gas or liquid or can even affect the atom&#39;s motion; even give off its own &quot;light&quot;.\u003cbr\u003eWe do not see a photon as it travels through the aether.  When the photon or other electromagnetic wave hits matter, it slows down and even stops.  As the photon does this the photon&#39;s energy turns into visible light. \u003cbr\u003e\u003cbr\u003ePS:  Dark matter gravity and dark energy is nothing more than the gravity created by the matter inside a galaxy moving about, pressing against the aether, and then the aether presses back with gravity caused by that motion.  All the electromagnetic waves (photons) bouncing around the galaxy also add to the missing gravity that some say is caused by dark matter.  Nothing dark (unknown) about it.  Look to the movement of matter and electromagnetic waves (including photons).",
            "textOriginal": "Matter and dark matter: Galaxies rotate too fast but are not torn apart.  What causes galaxies from flying apart?\n\nBy Csaba A. Bodor.  Last edited April 4, 2022\n\ngravity, they say, is associated with baryonic matter and with dark matter.  EVEN better:  gravity is associated with the mass of baryonic matter and the SPEED of motion of the former.  Dark matter gravity is caused by ordinary baryonic matter in motion!\n\nSome speculate that a mysterious substance called \"dark matter\" must exist which holds the galaxies together.    I submit that this dark matter is nothing more than ordinary matter which is in motion around the galactic core and around the billions of stars.\n\nMatter that is in motion presses against the aether of space (to those stuck in the Einstein loop, it is also called space-time) and the aether presses back in the form of gravity and the moving matter also creates time dilation.\n\nThis gravity could be the missing gravity that is holding galaxies together. \n\nThere are two types of time dilation.  One is caused by the aether's affect on matter and the other is the aether's affect on speeding matter or electromagnetic \"waves\".\nAs matter, of any size, displaces the aether, the aether presses back with what we call gravity.  This gravity presses on the matter affecting it's \"being\".  All activity of matter os slowed down.  The cesium in a cesium clock runs slower because the nuclear particles of cesium are slowed down.  The clock therefore runs slower.  Radioactive elements all run slower; their half-lifes are increased. Their internal subatomic particles run slower.  \nThe microprocessors and other perts of computers all run slower.  Our brains are affected also and our minds work slower.  Everything near and about that matter that intruded into the realm that belongs to the aether runs slower.\n\nAs one moves away from the mass of that large mass we live on the press of the aether becomes less and the particles and pieces of the atoms will run faster since the gravity created by the aether slowly lessons as we move away from the large mass.  That cesium clock runs faster.  The half-life of the radioactive elements changes and its \"time\" is affected.\n\nHumans living further from the mass of the earth will perceive time as running faster.  Computers will likewise run faster.\n\nTime dilation that is caused by motion comes about because of the motion of matter or electromagnetic waves through the aether.  A photon traveling at \"C\" pushes against the aether, the aether pushes back and creates gravity.  The internal properties of the photon or even matter are slowed down.  As humans move through the aether at great speeds we perceive the time runs slower for us.  Time dilation.\n\nFor a photon, because it is traveling at \"C\", time actually stops.  The photon experiences NO time.\n\nThe photon cannot travel faster than \"C\" because the aether sets the speed limit by pushing against the photon's motion through the aether.  This is also why matter cannot go faster than \"C\".  \n\nWhen light goes through a gas or a liquid it is forced to slow down and give part of its energy to the gas or liquid which eats into the photon's ability to move at \"C\". The energy given up heats up the gas or liquid or can even affect the atom's motion; even give off its own \"light\".\nWe do not see a photon as it travels through the aether.  When the photon or other electromagnetic wave hits matter, it slows down and even stops.  As the photon does this the photon's energy turns into visible light. \n\nPS:  Dark matter gravity and dark energy is nothing more than the gravity created by the matter inside a galaxy moving about, pressing against the aether, and then the aether presses back with gravity caused by that motion.  All the electromagnetic waves (photons) bouncing around the galaxy also add to the missing gravity that some say is caused by dark matter.  Nothing dark (unknown) about it.  Look to the movement of matter and electromagnetic waves (including photons).",
